import { useEffect , useState } from "react";
import { Box,Grid } from "@mui/material";
import '../../css/home/investorsHome.css'
export default function InvestorsHome (){
    return(
        <Box sx={{ minHeight: '60vh', marginTop: '10px' }}>
             <Grid container spacing={2}>
                <Grid item xs={6}>
                    <div className="investor-home-heading-first">Trusted and<span className="colored-investor-home-heading"> Backed </span>by</div>
                </Grid>
            </Grid>
        </Box>
    )
}
